import React,{ Component } from 'react';
import {
    HomeWrap,
    HomeLeft,
    HomeRight,
    LeftBr
} from './style';
import LeftBanner from './component/leftbanner'
class Home extends Component {
    render () {
        return(
            <HomeWrap>
                <HomeLeft>
                    <LeftBanner/>
                    <LeftBr/>123
                </HomeLeft>
                <HomeRight></HomeRight>
            </HomeWrap>
        )
    }
}
export default Home;
